import { Grid, TextField } from '@material-ui/core';

const SignUp = () => {
	return (
		<Grid container spacing={2}>
			<Grid item sm={4} md={4} style={{ padding : '10%' }}>
				<TextField 
					id="outlined-basic" 
					label="first name" 
					variant="outlined" 
					helperText="Please enter your first name"
					style={{ width : '80%' }}
					fullWidth
					margin = 'normal'
				/>
			</Grid>
			<Grid  item sm={4} md={4}>
				<TextField 
					id="outlined-basic" 
					label="last name" 
					variant="outlined"
					helperText="Please enter your last name"
					style={{ width : '80%' }}
					margin = 'normal'
					// size="small"
				/>
			</Grid>		
		</Grid>
	);
};

export default SignUp;
